import axios from "axios"
import React from "react"

const Main = () => {
  return (
    <main className="main">
        <button
          type="submit"
          onClick={() => {
            axios
              .post("localhost:5000/api/call", {
                name: "Grisha",
                numberPhone: "66666",
              })
              .then((res) => {
                console.log(res.data)
              })
              .catch((err) => {
                console.error(err)
              })
          }}
        >
          Отправить
        </button>
    </main>
  )
}

export default Main
